 CREATE TABLE `shang_crowd_voting` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `crowd_id` int(10) NOT NULL,
  `crowd_money` decimal(12,2) NOT NULL COMMENT '集资额度',
  `vote_money` decimal(12,2) NOT NULL COMMENT '投票额度',
