  `has_vote_people` int(11) NOT NULL COMMENT '已经投票的人数',
  `not_agree_people` int(11) NOT NULL COMMENT '不赞成人数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=latin1;/* DBReback Separation */
